"use strict";

function countVowelPermutation(n) {
    let dp = [1, 1, 1, 1, 1];
    const MOD = 1000000007;
    for (let i = 1; i < n; i++) {
        dp = [
            (dp[1] + dp[2] + dp[4]) % MOD,
            (dp[0] + dp[2]) % MOD,
            (dp[1] + dp[3]) % MOD,
            dp[2],
            (dp[2] + dp[3]) % MOD,
        ];
    }
    return dp.reduce((a, b) => (a + b) % MOD, 0);
}
